insert into catena values ('1','Esselunga','https://www.cellicomsoft.com/wp-content/uploads/2021/01/Esselunga-logo.png','Esselunga S.p.A. è una società italiana operante nella grande distribuzione organizzata nell \'Italia settentrionale e centrale con supermercati e superstore. Controllata da Supermarkets Italiani, Esselunga gestisce circa l\'8,7% delle vendite in supermercati e ipermercati italiani con oltre 170 punti vendita presenti nelle regioni Lombardia, Veneto, Piemonte, Emilia-Romagna, Toscana, Liguria e Lazio.','https://www.esselunga.it/cms/homepage.html');
insert into catena values ('2','Carrefour','https://w7.pngwing.com/pngs/871/662/png-transparent-carrefour-logo-retail-cdr-voucher-text-supermarket-area.png','Carrefour S.A. è una catena di supermercati e ipermercati francese, fondata ad Annecy nel 1959. Carrefour è il quarto più grande gruppo di vendita al dettaglio nel mondo in termini di reddito e vendite e il secondo a livello europeo, dopo la tedesca Schwarz Gruppe. È presente in 30 paesi, principalmente nell \' Unione europea, Brasile e Argentina, oltre che in Nord Africa e in Asia.
insert into catena values ('3','Pam','https://www.brainatwork.it/wp-content/uploads/2022/10/pam.supermercati.png','Il Gruppo PAM S.p.A. è un \'azienda italiana fondata nel 1958 operante nella grande distribuzione, attiva anche nella ristorazione, ed è interamente controllata dalla holding finanziaria Gecos S.p.A.
insert into catena values ('4','Coop','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSNTNO_SoNTwe2plglymfs17LZcBOAD6W0X0XdpSeG-_yWnmqfValqiTYZafVIgGGzWugI&usqp=CAU','Coop Italia è un sistema di cooperative italiane che comprende una rete di superette, supermercati e ipermercati. Il marchio è attribuito alle cooperative di consumatori consociate a Coop Italia, a sua volta aderente alla Lega nazionale cooperative e mutue.
