La rete di vendita è formata da ipermercati, centri commerciali, market di prodotti alimentari, propri format commerciali, marchi affiliati; in Italia vi sono attualmente presenti 1.479 punti vendita Carrefour, suddivise in: Ipermercati Carrefour, Carrefour Market, Carrefour Express e Cash and Carry','https://www.carrefour.it/');
La sede legale del gruppo è a Venezia, quella amministrativa è a Spinea in provincia di Venezia. Il nome PAM è acronimo di "Più A Meno".','https://www.pampanorama.it/');
I punti vendita Coop sono diffusi soprattutto nel Centro e nel Nord Italia, e in modo particolarmente consistente in Toscana e in Emilia Romagna. Sebbene stia incrementando la propria presenza nel Sud (specialmente in Puglia) e nelle Isole, il sistema non copre tutto il territorio nazionale.
La finalità principale delle cooperative di consumatori consiste nel tutelare il potere d\'acquisto e la sicurezza alimentare. A questo scopo esse acquistano beni di qualità per rivenderli a prezzi vantaggiosi ai propri soci e in generale ai consumatori. Tra i principali obiettivi di Coop c\'è anche la promozione degli alimenti biologici.
Coop Italia, nonostante la somiglianza nel nome e nel logo, non ha alcun rapporto societario con Coop Svizzera né con la norvegese Coop Norge né con la nederlandese Coop.','https://www.coop.it/');


